<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1" />
    <title>Redirecting...</title>
    <script>
      (function () {
        const searchParams = new URLSearchParams(window.location.search);
        if (searchParams.has("originalUrl")) {
          // this means we are in a redirect loop, so we need to just show the 404 message
          return;
        }

        const path = window.location.pathname;

        const previewMatch = path.match(
          /^(?:\/raweb)?\/deploy-preview\/([^/]+)/
        );
        const isPreview = Boolean(previewMatch);

        const hasRawebPrefix = path.startsWith("/raweb");

        const base = isPreview
          ? hasRawebPrefix
            ? `/raweb/deploy-preview/${previewMatch[1]}`
            : `/deploy-preview/${previewMatch[1]}`
          : hasRawebPrefix
          ? `/raweb`
          : ``;

        function goto(page) {
          location.replace(
            `${base}/${page}.html?originalUrl=${encodeURIComponent(
              window.location.href
            )}`
          );
        }

        if (path.endsWith("/login") || path.endsWith("/login/")) {
          goto("login");
        } else if (path.endsWith("/logoff") || path.endsWith("/logoff/")) {
          goto("logoff");
        } else if (path.endsWith("/password") || path.endsWith("/password/")) {
          goto("password");
        } else if (path.endsWith("/docs") || path.includes("/docs/")) {
          goto("docs");
        } else {
          goto("index");
        }
      })();
    </script>
  </head>

  <style>
    :root {
      --wui-font-family-text: "Segoe UI Variable Text",
        "Seoge UI Variable Static Text", "Segoe UI", -apple-system,
        ui-sans-serif, system-ui, BlinkMacSystemFont, Helvetica, Arial,
        sans-serif;
      --wui-font-size-body: 14px;
      --wui-control-corner-radius: 4px;
      --wui-control-faster-duration: 87ms;
      color-scheme: light dark;
      --wui-text-primary: light-dark(hsla(0, 0%, 0%, 0.89), hsl(0, 0%, 100%));
      --wui-text-disabled: light-dark(
        hsla(0, 0%, 0%, 0.36),
        hsla(0, 0%, 100%, 0.36)
      );
      --wui-control-stroke-default: light-dark(
        hsla(0, 0%, 0%, 0.06),
        hsla(0, 0%, 100%, 0.07)
      );
      --wui-control-stroke-secondary-overlay: light-dark(
        hsla(0, 0%, 0%, 10.44%),
        hsla(0, 0%, 0%, 2.32%)
      );
      --wui-control-fill-default: light-dark(
        hsla(0, 0%, 98.5%, 0.7),
        hsla(0, 0%, 100%, 0.06)
      );
      --wui-control-fill-secondary: light-dark(
        hsla(0, 0%, 96%, 0.5),
        hsla(0, 0%, 100%, 0.08)
      );
      --wui-control-fill-tertiary: light-dark(
        hsla(0, 0%, 92%, 0.3),
        hsla(0, 0%, 100%, 0.03)
      );
      --wui-control-fill-disabled: light-dark(
        hsla(0, 0%, 98%, 0.3),
        hsla(0, 0%, 100%, 0.04)
      );
    }
    @media (prefers-reduced-motion: reduce) {
      :root {
        --wui-control-faster-duration: 0;
      }
    }
    html {
      background-color: light-dark(hsl(0, 0%, 95%), hsl(0, 0%, 16%));
      height: 100%;
    }
    body {
      height: 100%;
      margin: 0;
      padding: 36px;
      box-sizing: border-box;
    }
    article {
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      block-size: 100%;
      inline-size: 100%;
      gap: 16px;
      padding: 24px 16px;
      box-sizing: border-box;
      height: 100%;
      text-align: center;
    }
    article h1 {
      font-family: "Segoe UI Variable Display",
        "Seoge UI Variable Static Display", "Segoe UI", -apple-system,
        ui-sans-serif, system-ui, BlinkMacSystemFont, Helvetica, Arial,
        sans-serif;
      font-weight: 600;
      font-size: 20px;
      line-height: 28px;
    }
    article .buttons {
      text-align: center;
    }
    article .prose {
      font-family: var(--wui-font-family-text);
      font-weight: 400;
      font-size: var(--wui-font-size-body);
      line-height: 20px;
    }
    article .prose > * {
      margin-bottom: 4px;
    }
    article .prose > *:last-child {
      margin-bottom: 2px;
    }
    article .button-row {
      display: flex;
      flex-direction: row;
      gap: 8px;
